import styles from './filters.module.css';

export default function Filters (props) {

    let startYear = 2006;
    let endYear = 2020;
    let launchYearFilter = [];
    for(let i = startYear; i <= endYear; i++) {
        launchYearFilter.push(
            <button 
                key={i} 
                onClick={() => props.handleFilterYearClick(i)}
                className={styles.filterButton} > {i} 
            </button>
        );
    }

    return (
        <div className={styles.filter}>
            <div className={styles.filterContents}>
                <div className={styles.filterHeroTitle}>
                    Filters
                </div>
                <div className={styles.yearFilterContainer}>
                    <div className={styles.filterHero}> Year </div>
                    {launchYearFilter}
                </div>
                <div className={styles.yearFilterContainer}>
                    <div className={styles.filterHero}> Sucessful Launch </div>
                    <button onClick={() => props.handleFilterSucessfulLaunch(true)}> True </button>
                    <button onClick={() => props.handleFilterSucessfulLaunch(false)}> False </button>

                </div>
                <div className={styles.yearFilterContainer}>
                    <div className={styles.filterHero}> Sucessful Landing </div>
                    <button onClick={() => props.handleFilterSucessfulLanding(true)}> True </button>
                    <button onClick={() => props.handleFilterSucessfulLanding(false)}> False </button>
                </div>
            </div>

        </div>
    );
}
